VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Osteoporosis On this page Basics Summary Start Here Diagnosis and Tests Prevention and Risk Factors Treatments and Therapies Learn More Living With Related Issues Specifics Genetics See, Play and Learn Videos and Tutorials Test Your Knowledge Research Statistics and Research Clinical Trials Journal Articles Resources Find an Expert For You Children Men Women Older Adults Patient Handouts Summary What is osteoporosis? Osteoporosis is a disease in which your bones become weak and are likely to fracture (break). The disease can develop when your bone mineral density and bone mass decrease. It can also happen if the structure and strength of your bones change. Osteoporosis is called a "silent" disease because it doesn''t usually cause symptoms. You may not even know you have the disease until you break a bone. This could happen with any bone, but it''s most common in the bones of your hip, vertebrae in the spine, and wrist. What causes osteoporosis? Your bones are made of living tissue.', '{0.10850910097360611,-0.03631138056516647,1.0004044771194458,-0.43577465415000916,-0.44516193866729736,0.28414565324783325,0.29636672139167786,0.5366953015327454,-0.12987633049488068,-0.5527490377426147,0.43060198426246643,0.26798510551452637,-0.1425461322069168,-0.8335889577865601,-1.5595020055770874,-0.7971571087837219,-0.05311354994773865,0.01551038771867752,0.15151706337928772,-0.4459969699382782,0.2362307608127594,-0.21568968892097473,-0.4689406156539917,0.24165239930152893,-0.11603277921676636,0.13645145297050476,-0.9101409912109375,-0.22826246917247772,0.8267598748207092,0.22460174560546875,-0.7128304243087769,-0.09226556867361069,0.08527875691652298,0.018386192619800568,-0.04017123207449913,0.13876225054264069,0.09472396224737167,0.6421370506286621,-0.256837397813797,-0.3298075497150421,0.33687475323677063,0.9277209639549255,-0.27011579275131226,0.26117753982543945,-0.45486167073249817,0.7533018589019775,0