VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, ', vertebrae in the spine, and wrist. What causes osteoporosis? Your bones are made of living tissue. To keep them strong, your body breaks down old bone and replaces it with new bone. Osteoporosis develops when more bone is broken down than replaced. You lose bone mass and changes happen in the structure of your bone tissue. This can happen as you get older. Other risk factors can also lead to the development of osteoporosis or increase your chance of developing the disease. Who is more likely to develop osteoporosis? Anyone can develop osteoporosis, but you are more likely to develop it if you have one or more of risk factors: Your sex. Osteoporosis is more common in women. Your age. Your risk increases as you get older. It is most common in people over age 50. Your body size. It is more common in people who are slim and thin boned. Your race: White and Asian women are at highest risk. African American and Mexican American women have a lower risk.', '{0.5036227107048035,0.16533659398555756,0.7955941557884216,0.059997402131557465,-0.6309700012207031,0.16329306364059448,-0.023339027538895607,0.6229831576347351,0.3966650366783142,-0.3437417149543762,0.35650771856307983,0.23351648449897766,-0.3674411177635193,-0.9211106300354004,-1.395309329032898,-0.7522491812705994,0.09629620611667633,0.07554128021001816,0.25785374641418457,-0.5601575374603271,0.3458423614501953,-0.47900867462158203,-0.27400022745132446,0.30713406205177307,-0.5379267334938049,0.11952660232782364,-0.7625146508216858,-0.34311360120773315,0.8388936519622803,0.6508772373199463,-0.8869932293891907,-0.014315346255898476,0.13063377141952515,-0.055615946650505066,0.08080561459064484,0.1655828356742859,0.2022385448217392,0.6557246446609497,-0.2892593741416931,-0.7438861727714539,0.0064888158813118935,0.8704935908317566,-0.003508008550852537,-0.14598903059959412,-0.4526593089103699,0.364154189825058,0.18649347126483917,-0.34331661462783813