VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Epilepsy On this page Basics Summary Start Here Diagnosis and Tests Treatments and Therapies Learn More Living With Related Issues Specifics Genetics See, Play and Learn Images Research Statistics and Research Clinical Trials Journal Articles Resources Find an Expert For You Children Teenagers Women Patient Handouts Summary Epilepsy is a brain disorder that causes people to have recurring seizures. The seizures happen when clusters of nerve cells, or neurons, in the brain send out the wrong signals. People may have strange sensations and emotions or behave strangely. They may have violent muscle spasms or lose consciousness. Epilepsy has many possible causes, including illness, brain injury, and abnormal brain development. In many cases, the cause is unknown. Doctors use brain scans and other tests to diagnose epilepsy. It is important to start treatment right away. There is no cure for epilepsy, but medicines can control seizures for most people.', '{-0.15650445222854614,-0.2732643187046051,0.6862743496894836,-0.8101500868797302,-0.07837545871734619,0.4926898777484894,0.21105718612670898,-0.3775472640991211,-0.7643575668334961,0.23935098946094513,0.30450794100761414,0.6516425013542175,0.44726869463920593,0.6219832897186279,-0.8586267232894897,0.25105178356170654,0.11947362869977951,-0.19407536089420319,-0.21411126852035522,-0.06528787314891815,-0.9516403079032898,0.20515964925289154,-0.6967792510986328,-0.34218356013298035,0.33535775542259216,-0.04174403101205826,-0.29073694348335266,0.2386314868927002,-0.42237749695777893,0.03773289546370506,-0.927094042301178,0.037990447133779526,0.15162836015224457,0.6232948303222656,-0.4237331449985504,-0.14790497720241547,-0.5446345806121826,0.2871282398700714,1.1740124225616455,-0.49242886900901794,0.10062138736248016,0.25400614738464355,-0.5394228100776672,0.032881394028663635,-0.07404441386461258,0.45587265491485596,-0.44433629512786865,0.22574780881404