VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Asthma On this page Basics Summary Start Here Diagnosis and Tests Prevention and Risk Factors Treatments and Therapies Learn More Living With Related Issues Specifics Genetics See, Play and Learn Images Videos and Tutorials Test Your Knowledge Research Statistics and Research Journal Articles Resources Find an Expert For You Children Women Older Adults Patient Handouts Summary What is asthma? Asthma is a chronic (long-term) lung disease. It affects your airways, the tubes that carry air in and out of your lungs. When you have asthma, your airways can become inflamed and narrowed. This can cause wheezing, coughing, and tightness in your chest. When these symptoms get worse than usual, it is called an asthma attack or flare-up. What causes asthma? The exact cause of asthma is unknown. Genetics and your environment likely play a role in who gets asthma. An asthma attack can happen when you are exposed to an asthma trigger.', '{0.21156278252601624,-0.8454610705375671,-0.0962500348687172,-0.9570717215538025,0.3172336518764496,1.430457353591919,0.42149385809898376,0.27352240681648254,-0.06300848722457886,-0.6301526427268982,0.23529461026191711,0.23142538964748383,-0.04615774378180504,-0.8509934544563293,-0.5671927332878113,0.2854614853858948,0.6205916404724121,0.16877971589565277,0.2062397003173828,-0.12672802805900574,-0.5091245770454407,-0.5323070287704468,-0.2996010482311249,0.475654274225235,-0.2416309118270874,0.6714592576026917,-1.0807400941848755,-0.11791170388460159,0.232336163520813,-0.19463983178138733,-0.43204033374786377,-0.24166981875896454,-0.3263366222381592,0.13388550281524658,-0.15992097556591034,0.1835242509841919,-0.04905106872320175,0.5162612795829773,-0.8189733624458313,-0.25663211941719055,0.2797170579433441,1.554571270942688,-0.26004236936569214,-0.28859743475914,-0.21669849753379822,0.47647568583488464,0.6279965043067932,-0.07756073772907257,-0.09844022989273071,0.6831724047660