VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ay a role in who gets asthma. An asthma attack can happen when you are exposed to an asthma trigger. An asthma trigger is something that can set off or worsen your asthma symptoms. Different triggers can cause different types of asthma: Allergic asthma is caused by allergens. Allergens are substances that cause an allergic reaction. They can include Dust mites Mold Pets Pollen from grass, trees, and weeds Waste from pests such as cockroaches and mice Nonallergic asthma is caused by triggers that are not allergens, such as Breathing in cold air Certain medicines Household chemicals Infections such as colds and the flu Outdoor air pollution Tobacco smoke Occupational asthma is caused by breathing in chemicals or industrial dusts at work Exercise-induced asthma happens during physical exercise, especially when the air is dry Asthma triggers may be different for each person and can change over time. Who is at risk for asthma?', '{0.6913339495658875,-0.8539135456085205,-0.2348264753818512,-0.4437929093837738,0.06029446795582771,1.3748117685317993,-0.06457696855068207,0.6134952306747437,0.2940405309200287,-0.6572257280349731,0.5468217730522156,0.1157551258802414,-0.059648606926202774,-0.9772263169288635,-0.5057638883590698,0.2828429937362671,0.4913368821144104,0.16200047731399536,0.25260770320892334,-0.5064605474472046,-0.7260318994522095,-0.47922852635383606,-0.2791706621646881,0.26968279480934143,-0.9849334359169006,0.5284484624862671,-0.7513903379440308,-0.44696035981178284,0.17349886894226074,0.27699384093284607,-0.4372478425502777,-0.2965639531612396,-0.37010568380355835,0.4343630373477936,0.08674415946006775,0.3855503797531128,-0.058500226587057114,0.4494580924510956,-0.7001606822013855,-0.37608569860458374,-0.008297937922179699,1.2072422504425049,0.17889773845672607,-0.5161517262458801,-0.33556851744651794,0.46535155177116394,0.4587518870830536,-0.6238759756088257,0.10047943890094757,0.63466745