VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'try, to test how well your lungs work Tests to measure how your airways react to specific exposures. During this test, you inhale different concentrations of allergens or medicines that may tighten the muscles in your airways. Spirometry is done before and after the test. Peak expiratory flow (PEF) tests to measure how fast you can blow air out using maximum effort Fractional exhaled nitric oxide (FeNO) tests to measure levels of nitric oxide in your breath when you breathe out. High levels of nitric oxide may mean that your lungs are inflamed. Allergy skin or blood tests, if you have a history of allergies. These tests check which allergens cause a reaction from your immune system. What are the treatments for asthma? If you have asthma, you will work with your health care provider to create a treatment plan. The plan will include ways to manage your asthma symptoms and prevent asthma attacks. It will include: Strategies to avoid triggers.', '{0.8041625022888184,-0.5912598371505737,-0.15690751373767853,-0.47566449642181396,0.14836429059505463,1.229102611541748,-0.009183528833091259,0.09776588529348373,0.22160634398460388,-0.6986953616142273,0.4450376331806183,-0.5711361765861511,0.1315838247537613,-0.7821291089057922,-1.113006353378296,0.21128897368907928,0.47799068689346313,0.007015671581029892,0.5645881295204163,0.3230564594268799,-0.677409827709198,-0.8188091516494751,-0.23048703372478485,-0.20987805724143982,-0.5363430976867676,0.7134568095207214,-0.5146292448043823,-0.5238244533538818,0.3684927225112915,0.3549808859825134,-0.4982251822948456,-0.09556901454925537,-0.36500513553619385,-0.003299592761322856,0.21644209325313568,-0.07460144907236099,-0.27023056149482727,-0.21192540228366852,-1.0884431600570679,-0.1284462809562683,-0.030327055603265762,1.0662214756011963,-0.4379906952381134,-0.7105981111526489,-0.36725395917892456,-0.289676308631897,0.4152182936668396,-0.7179641127586365,0.391699