VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'How the Heart Works Home < Back To Health TopicsHow the Heart Works 0 How the Heart Works MENU Home < Back To Health TopicsHow the Heart Works The Heart What the Heart Looks Like How Blood Flows through the Heart How the Heart Beats MORE INFORMATION Fact Sheets and Handouts How the Heart Works How the Heart Works The Heart Language switcherEnglishEspaol The heart is an organ about the size of your fist that pumps blood through your body. It is made up of multiple layers of tissue. Your heart is at the center of your circulatory system. This system is a network of blood vessels, such as arteries, veins, and capillaries, that carries blood to and from all areas of your body. Your blood carries the oxygen and nutrients that your organs need to work properly. Blood also carries carbon dioxide to your lungs so you can breathe it out. Inside your heart, valves keep blood flowing in the right direction. Your hearts electrical system controls the rate and rhythm of your heartbeat.', '{-0.35270458459854126,0.11293302476406097,-0.35701432824134827,-0.04258508235216141,0.0071757095865905285,0.3751246929168701,0.39663317799568176,0.16022996604442596,-1.0508580207824707,-0.6972400546073914,1.1845299005508423,0.14866584539413452,0.148251473903656,-0.6537558436393738,-1.1477562189102173,0.21801406145095825,0.293416291475296,0.011455963365733624,-0.07902552932500839,-0.1777869611978531,-0.1897639036178589,-0.24505451321601868,-0.7208148837089539,0.1306384652853012,0.9073106646537781,-0.14123032987117767,-0.3133190870285034,-0.9886624217033386,-0.42044636607170105,0.26969826221466064,-0.7694866061210632,-0.1861976534128189,0.3282195031642914,1.2913219928741455,0.3319123089313507,-0.08924348652362823,-0.37090516090393066,0.45078927278518677,0.47116079926490784,-0.39645177125930786,0.09839706867933273,-0.8264990448951721,-0.1382807344198227,0.10440908372402191,-0.34638237953186035,-0.7790518999099731,0.22825981676