VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Home Health Information Diabetes English English Espaol Diabetes Diabetes is a disease that occurs when your blood glucose, also called blood sugar, is too high. Over time, having too much glucose in your blood can cause other health problems such as heart disease, nerve damage, eye problems, and kidney disease. You can take steps to prevent or manage diabetes. According to the Centers for Disease Control and Preventions National Diabetes Statistics Report, an estimated 38.4 million people in the United States, or 11.6% of the population, have diabetes. About 1 in 5 adults with diabetes dont know they have the disease. An estimated 97.6 million American adults have prediabetes, which means their blood glucose levels are higher than normal but not high enough to be diagnosed as diabetes. Many areas of the body can be affected by diabetes. Learn about diabetes health problems. Featured Topics What is Diabetes?', '{-0.11997617781162262,-0.8869869112968445,-0.28176620602607727,0.2803973853588104,0.32517653703689575,0.9645929336547852,0.6166399717330933,-0.10312377661466599,0.2697872519493103,-0.20167557895183563,0.4390900135040283,0.4474896788597107,-0.3929193615913391,-1.2650433778762817,-0.4824143648147583,-0.07431820780038834,0.5695516467094421,0.545695960521698,0.1414100080728531,-0.34266209602355957,0.06471814215183258,-0.2442930042743683,-0.14531582593917847,-0.09594503790140152,0.3441965579986572,-0.25762853026390076,-0.4153338074684143,-0.5131524205207825,-0.2021324336528778,0.20659266412258148,-0.45084890723228455,-0.09981298446655273,0.31087568402290344,0.8132503628730774,-0.10447480529546738,0.009548567235469818,-0.3149944841861725,0.3671397268772125,0.5412026643753052,-0.37729620933532715,0.28354695439338684,0.5429405570030212,0.3803330659866333,0.4186185300350189,-0.4423217475414276,0.029765399172902107,0.8540991544723511,0.2998203933238983,0.8574023842811584,0.1576250046491623,-0.21586