VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Home Health Information Kidney Disease English English Espaol Kidney Disease The kidneys are two bean-shaped organs. Each kidney is about the size of a fist. Your kidneys filter extra water and wastes out of your blood and make urine. Kidney disease means your kidneys are damaged and cant filter blood the way they should. You are at greater risk for kidney disease if you have diabetes or high blood pressure. If you experience kidney failure, treatments include kidney transplant or dialysis. Other kidney problems include acute kidney injury, kidney cysts, kidney stones, and kidney infections.', '{-0.2144606113433838,0.35592928528785706,0.17443160712718964,-0.0749070942401886,0.2533278465270996,0.3392612338066101,0.15710553526878357,0.5235174298286438,-0.9359584450721741,-0.7391836643218994,0.24279527366161346,0.4217645823955536,0.6256063580513,0.2416551560163498,-0.7774055600166321,-0.1826762855052948,-0.4379012882709503,-0.01423997338861227,-0.478380024433136,-0.34102603793144226,-0.6394019722938538,-0.013997325673699379,-0.8240018486976624,0.5722593069076538,0.6617757678031921,-0.45499640703201294,-0.6150362491607666,-0.42607560753822327,-0.34664469957351685,-0.1831028014421463,-0.5613918900489807,-0.6146600246429443,0.937879741191864,0.622281014919281,0.3779101073741913,-0.08416002988815308,-0.47957730293273926,0.2400524765253067,-0.7620331048965454,0.05516906827688217,0.011856457218527794,-0.06090693548321724,0.2077304720878601,-0.7635414004325867,-0.1900758445262909,-0.40875524282455444,0.2869992256164551,0.4465791881084442,0.15574634075164795,0.6057865023612976,-0.7212743163108826,-0.5642806887626648,-0.8293623924255371,0.41613876819610596,-0.34390145540237427,0.2867586612701416,0.3579829931259155,0.147981196641922,-0.5182102918624878,0.27503737807273865,-1.2022727727890015,0.4393531382083893,0.3446612060070038,-0.48886674642562866,-0.0825473740696907,0.9403748512268066,0.564395010471344,0.